The UTM helps to indicate performance based on specific segment on Google Analytics side. For example UTM content part {site_id} is crucial if we want to see the performance on GA side by site and site id. This allows you to create the whitelist/blacklist based on the performance with specific site/app ids and use it in Eskimi DSP campaign. 
By default ESKIMI UTMs include: 
UTM source - eskimi
UTM medium - cpm
UTM campaign - {campaign_title}
UTM term - {creative_size}
UTM content - eskimidsp_{site_id}
The UTMs' values and macroses can be also updated based on the needs.
It is a pretty common case that GA report shows a poor performance of specific campaign in terms of session rate, bounce rate, etc. while the landing page of that particular campaign does not have any UTMs. That means that you are not able to filter the performance by site id or any other segment on GA side, therefore leaving you without any possibility to optimise the campaign on Eskimi DSP side.
